import React from "react" ; 
import Header from "./Header.jsx"
import Note from "./Note.jsx"
import Footer from "./Footer.jsx"
import notes  from  "../notes.js"

const App = () =>{
    return (
        <div>
            <Header/>
            {
                notes.map(noteItem  =>  {
                    <Note
                    key = {noteItem.key}
                    key = {noteItem.key}
                    key = {noteItem.key}
                     />
                })
            }
            <Footer/>
        </div>
    )
}

export default  App ;
